import React from 'react'
import Dashboard from '../Dashboard'
import ProgramCard from '../components/Cards'

export default function Movies() {
    return (
        <>
            <Dashboard/>
            <h1 className="pageHeader">Movies</h1>
            <ProgramCard/>
        </>
    )
}
